<html xmlns="http://www.w3.org/1999/xhtml">
    <head> <style>
        .no-render {
            display: none;
        }
    </style> <script>
      document.addEventListener("DOMContentLoaded", function() {
          // Select all elements with the class "no-render"
          var elements = document.querySelectorAll('.no-render');

          // Loop through each element and hide it, including its nested content
          elements.forEach(function(element) {
              // This is where the line to hide the element goes
              element.style.display = 'none';
          });
      });
  </script>
